INSERT INTO `activities` VALUES (25,2,'Ha llegado la hora. Reduce tu huella.','ha-llegado-la-hora-reduce-tu-huella-1','<p><span style=\"font-size: 12pt;\"> Los recursos del planeta se est&aacute;n agotando y urge un modelo respetuoso y saludable que asegure el futuro de nuevas generaciones. Llevar un estilo de vida sostenible es m&aacute;s que el logro de un consumo responsable, se trata de vivir en base a un compromiso con el medio ambiente y se puede alcanzar introduciendo peque&ntilde;as acciones en nuestro d&iacute;a a d&iacute;a. </span></p>\r\n<p><span style=\"font-size: 12pt;\"> Cada uno de nosotros se alimenta, se mueve y consume bienes y servicios.&nbsp; Y muchos de nosotros lo hacemos de forma poco responsable con el medio ambiente. <strong>La pregunta es la siguiente &iquest;Sirve de algo la acci&oacute;n sostenible de unos pocos? La respuesta es si, cada gesto cuenta.</strong></span></p>','<p style=\"margin: 13.5pt 0cm 0cm; font-size: 12pt; font-family: \'Times New Roman\', serif; color: #000000; text-align: justify; line-height: 18.4px;\"><span lang=\"ES-TRAD\" style=\"font-family: Cambria, serif;\">&nbsp;<video autoplay=\"autoplay\" controls=\"controls\" width=\"540\" height=\"420\">\r\n&gt; source src=\"../../../../storage/files/uploads/LA%20NATURALEZA%20NOS%20ESTA%CC%81%20AVISANDO%20(2).mp4\" type=\"video/mp4\" /&gt;<source src=\"../../../../storage/files/uploads/LA%20NATURALEZA%20NOS%20ESTA%CC%81%20AVISANDO%20(2).mp4\" type=\"video/mp4\" /></video></span></p>\r\n<p style=\"margin: 13.5pt 0cm 0cm; font-size: 12pt; font-family: \'Times New Roman\', serif; color: #000000; line-height: 18.4px; text-align: center;\">&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"> Si estamos conectados con la naturaleza comprenderemos que hay muchas cosas que podemos mejorar para salvaguardar el recurso natural. A veces nos olvidamos de la necesidad de cuidar y mimar m&aacute;s nuestro entorno, de minimizar nuestra huella de carbono y en definitiva de ser m&aacute;s respetuosos.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong> Debemos ser conscientes de que detr&aacute;s de todas las decisiones que tomamos d&iacute;a a d&iacute;a, existe una contrapartida con el medio ambiente en forma de consumo de carb&oacute;n.</strong> La forma de movernos, la comida que comemos, la ropa que vestimos, la electricidad que usamos.</span></p>\r\n<p class=\"txtdestacadog\"><span style=\"font-size: 12pt;\"><strong>Existe una larga lista de peque&ntilde;as acciones que si puedes hacer individualmente. &Eacute;stas no s&oacute;lo tendr&aacute;n un efecto positivo en nuestro entorno sino que servir&aacute;n de ejemplo para que muchas m&aacute;s personas comiencen a aplicarlas en su d&iacute;a a d&iacute;a.</strong></span></p>\r\n<p><span style=\"font-size: medium;\">Porque la naturaleza nos est&aacute; avisando y no tenemos mucho tiempo. &iquest;Te unes al cambio?</span></p>\r\n<p>&nbsp;</p>','<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Descubre en qu&eacute; punto te encuentras.</h4>\r\n<p>En el primer reto de esta aventura queremos animarte a que averig&uuml;es d&oacute;nde te encuentras, desde d&oacute;nde partes antes de comenzar. Una manera adecuada de saberlo, puede ser analizando tu huella ecol&oacute;gica, sea cu&aacute;l sea &eacute;sta, esperamos que cuando finalice esta aventura, se haya visto disminuida.</p>\r\n<p><strong>Recuerda que la huella ecol&oacute;gica mide la superficie necesaria para producir los recursos consumidos por un ciudadano, as&iacute; como para absorber los residuos que genera.</strong></p>\r\n<p>A lo largo de estos d&iacute;as descubrir&aacute;s muchos nuevos h&aacute;bitos que te ayudar&aacute;n a llevar una vida m&aacute;s consecuente y sostenible. Aplica las acciones poco a poco, y ver&aacute;s que a medida que pasa el tiempo y avanza la aventura estar&aacute;s adoptando los nuevos h&aacute;bitos de una manera sencilla y natural.</p>\r\n<h3>DESAF&Iacute;O</h3>\r\n<p class=\"txtdestacadog\">Atr&eacute;vete a responder este TEST y descubre en qu&eacute; nivel de sostenibilidad se encuentra tu estilo de vida.</p>\r\n<p>&iquest;Est&aacute;s preparado para el cambio?</p>\r\n<div class=\"btnctr\"><a class=\"btn btn-primary\" href=\"https://pr.easypromosapp.com/p/937460\" target=\"_blank\" rel=\"noopener\">Acceso cuestionario</a></div>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/fotos-cuadradas-plataforma-420-x-420-px.png\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Ha llegado la hora</h4>\r\n<p>Puede que el test te haya hecho reflexionar, puede que incluso sea la primera vez que te planteas ciertas cuestiones. &iquest;Te fijas en el pl&aacute;stico que hay en tu carrito de la compra? &iquest;Te fijas en el origen de tus prendas de vestir? &iquest;Tienes en cuenta si un producto es de temporada a la hora de planificar tu men&uacute; semanal?</p>\r\n<h3>DESAF&Iacute;O</h3>\r\n<p class=\"txtdestacadog\">Se HONESTO y comparte con tus compa&ntilde;eros qu&eacute; perfil te ha salido en el TEST. &iquest;D&oacute;nde crees que pinchas m&aacute;s? &iquest;En la alimentaci&oacute;n? &iquest;En tu manera de desplazarte? &iquest;En tu consumo?</p>\r\n<p>&iquest;No crees que ha llegado la hora del cambio? Si&eacute;ntete libre de subir una foto que guarde relaci&oacute;n con ese aspecto que tienes que mejorar. &iexcl;Entre todos vamos a crear un Muro lleno de h&aacute;bitos a cambiar y mejorar! &iexcl;Lo importante no es lo que estamos haciendo si no lo que vamos a hacer a partir de ahora!</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/fotos-verticales-plataforma-420-x-420-px%20(1).gif\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n</div>',7,0,1,1,'2021-05-03 12:57:25','2022-04-19 05:20:19'),(26,3,'Pensar antes de tirar','pensar-antes-de-tirar-1','<p><span style=\"font-size: 12pt;\"> En nuestro planeta cada d&iacute;a que pasa se generan m&aacute;s y m&aacute;s residuos, de hecho, con todos los desechos generados en todo el mundo cada a&ntilde;o se podr&iacute;an llenar m&aacute;s de 800.000 piscinas ol&iacute;mpicas. Es por eso que urge la necesidad de dirigir nuestro estilo de vida hacia uno basado en un consumo responsable, en el que se adquiera lo que se necesita y se reutilicen aquellos residuos que puedan tener una segunda vida, es decir, otra utilidad.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong> El proceso de Reutilizar consiste precisamente en eso, en darle una segunda vida a un objeto del que pensabas deshacerte. </strong>Se trata de pensar dos veces antes de desechar un objeto al que ya no le estabas dando uso. Este simple hecho de volver a meterlo en el c&iacute;rculo estar&aacute; ayudando al medio ambiente y tambi&eacute;n a tu econom&iacute;a.</span></p>','<p><span style=\"font-size: 12pt;\">Una cosa es cierta, todos y cada uno de nosotros, podemos generar menos basura de la que estamos generando. Se trata de analizar nuestros h&aacute;bitos y detectar &aacute;reas de mejora para alargar la vida &uacute;til de los art&iacute;culos que utilizamos. De esta manera nos estaremos convirtiendo en consumidores m&aacute;s responsables.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Todo aquello que no podamos evitar utilizar debe ser utilizado tantas veces como nos sea posible, alargando as&iacute; su vida &uacute;til y evitando al mismo tiempo generar nuevos residuos..</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Nuevamente las posibilidades son infinitas. Todos los materiales o bienes pueden tener m&aacute;s de una vida &uacute;til, bien sea repar&aacute;ndolos para un mismo uso o con imaginaci&oacute;n para un uso diferente.</span></p>','<h4 style=\"text-align: left;\">El futuro del planeta no es desechable</h4>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\">En el anterior desaf&iacute;o de REUTILIZAR, ya hablamos de la infinidad de posibilidades que nos brinda la t&eacute;cnica del Upcyling, t&eacute;cnica que consiste en convertir un objeto en otro con una utilidad diferente a la original.&nbsp; Utilizando tu creatividad puedes convertir objetos o residuos en otros nuevos, adem&aacute;s de disfrutar de una entretenida distracci&oacute;n.&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Reducir los desechos incontrolados de los que a veces nos deshacemos sin pensar no es tan d&iacute;ficil. Adem&aacute;s, con este gesto, nuestro entorno y el medio ambiente nos lo agradecer&aacute;n.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\">A veces no se trata de convertir un objeto en otro sino mantener el mismo objeto y darle otra utilidad, como por ejemplo un cepillo de dientes muy gastado puede ser muy &uacute;til para la limpieza dom&eacute;stica.</span></p>\r\n<h4 style=\"text-align: left;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Hoy te desafiamos a que observes bien esta imagen y cojas ideas para reutilizar esos restos de alimentos u objetos gastados o viejos de los que te ibas a deshacer. Se trata de pensar dos veces antes de tirar. &iquest;Te animas?</span></p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"Copy - REUTILIZAR\" src=\"https://view.genial.ly/63db9af5457895001189a409\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\"><img style=\"float: left;\" src=\"../../../../storage/files/uploads/fotos-verticales-habitat.gif\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Reutilizar es una manera de frenar el consumo innecesario</h4>\r\n<p>Lo m&aacute;s interesante en este sentido es comprender que aunque el objeto haya dejado de servir para lo que fue ideado en un principio, no significa que haya dejado de sernos&nbsp;&uacute;til para alguna otra cosa.</p>\r\n<p>Esta acci&oacute;n por el planeta no solo contribuye a generar menos residuos y menos impacto medioambiental, sino que tambi&eacute;n puede suponer un verdadero alivio para nuestros bolsillos. &iquest;Y lo mejor de todo? Que es m&aacute;s simple de lo que crees.</p>\r\n<p>Transforma residuos en productos de valor. En un planeta en el que estamos acabando con los recursos de los que disponemos a pasos agigantados, la pr&aacute;ctica de reutilizar es muy necesaria para&nbsp;contribuir a un entorno m&aacute;s sostenible.</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te desafiamos a que compartas en el muro cu&aacute;l de las ideas que te proponemos en el desaf&iacute;o individual est&aacute;s aplicando ya en tu hogar, o cu&aacute;l de ellas crees que vas a poner en pr&aacute;ctica.</p>\r\n<h4>&nbsp;</h4>\r\n</div>\r\n</div>',3,0,1,1,'2021-05-03 12:57:25','2023-03-15 08:10:51'),(27,2,'Reducir el pl치stico, si es posible','reducir-el-plastico-si-es-posible','<p><strong>El pl&aacute;stico ha inundado nuestra vida diaria. En tan s&oacute;lo unas d&eacute;cadas ha pasado a ser omnipresente en todo tipo de objetos y materiales.</strong></p>\r\n<p>Podemos encontrarlo en envases de productos, en los propios ingredientes de cosm&eacute;ticos, en el textil de la ropa, en materiales de construcci&oacute;n, en multitud de utensilios y objetos.</p>\r\n<p>El pl&aacute;stico est&aacute; tan presente en nuestras vidas, que en recientes investigaciones se ha visto c&oacute;mo los residuos pl&aacute;sticos est&aacute;n protagonizando una verdadera invasi&oacute;n del cuerpo humano. &iquest;Y c&oacute;mo acceden? La principal fuente de exposici&oacute;n son los envases de los alimentos y los propios alimentos.</p>\r\n<p>Sino cuidamos nuestro entorno, o lo que nos da de comer, el entorno nos lo devuelve servido en forma de alimento. Uno de cada 6 peces en Espa&ntilde;a contiene micropl&aacute;sticos.</p>\r\n<p><strong>La reducci&oacute;n en el consumo de pl&aacute;sticos es responsabilidad de todos y a pesar de que es dif&iacute;cil de eliminar por completo si se puede reducir su uso.</strong></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>Como consecuencia de una mala gesti&oacute;n de los residuos o de su abandono, <strong>unos 8 millones de toneladas de pl&aacute;sticos acaban en los mares y oc&eacute;anos cada a&ntilde;o,</strong> formando el 60%-80% de la basura marina, en su mayor&iacute;a en forma de micropl&aacute;sticos, que pueden incluso acabar en nuestra cadena alimenticia.</p>\r\n<strong>La gesti&oacute;n de los pl&aacute;sticos es un problema global que est&aacute; aumentando de forma alarmante.</strong>\r\n<p>&iquest;Sab&iacute;as que 8 millones de toneladas de basura llegan a los mares y oc&eacute;anos (equivalente al peso de 800 Torre Eiffel) &oacute; &iquest;Qu&eacute; cada segundo m&aacute;s de 200 kilos de basura van a parar a los oc&eacute;anos. De hecho se estima que actualmente en los mares y oc&eacute;anos hay unos 5-50 billones de fragmentos de pl&aacute;stico.</p>\r\nPuede que cuando vayas al mar veas solo algunos pl&aacute;sticos en la superficie, pero no olvides que el 70% del pl&aacute;stico presente en el mar est&aacute; en el fondo marino. Lo que vemos es s&oacute;lo la punta del iceberg.\r\n<p class=\"txtdestacadog\">Puede que ahora seas m&aacute;s consciente de la problem&aacute;tica del pl&aacute;stico, no queremos ser catastrofistas, queremos lanzar un mensaje claro. Es responsabilidad de todos revertir esta situaci&oacute;n, porque estamos a tiempo de hacerlo.</p>\r\n</div>\r\n<div class=\"col-md-4\">&nbsp;</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>El pl&aacute;stico est&aacute; metido en nuestras vidas, a pesar de ello, se puede reducir.</h4>\r\n<p>Puede que est&eacute;s pensando &ldquo;pero si s&oacute;lo es una pajita&rdquo; pero una tras otra hacen que s&oacute;lo en Europa se utilicen 36.500 millones al a&ntilde;o. Por este motivo, hoy te vamos a pedir que hagas una reflexi&oacute;n.</p>\r\n<p>Est&aacute; claro que el pl&aacute;stico est&aacute; tan metido en nuestras vidas que no podemos pasar de 100 a 0 en un d&iacute;a. No se trata de un todo o nada, sino de hacer lo que buenamente podamos cada uno seg&uacute;n nuestras circunstancias. A medida que empieces te dar&aacute;s cuenta que siempre hay algo m&aacute;s por hacer.</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Mira a tu alrededor. Analiza todo aquel pl&aacute;stico que usas a diario o a menudo y que podr&iacute;as eliminar o sustituir por alternativas m&aacute;s respetuosas. Imprime este p&oacute;ster y ponlo en lugar visible de tu hogar o lugar de trabajo, te ayudar&aacute; a coger algunas ideas. &iquest;Porqu&eacute; no pruebas a hacer una compra libre de pl&aacute;sticos? Al principio te resultar&aacute; dif&iacute;cil pero piensa que &iexcl;No s&oacute;lo estar&aacute;s cuidando de tu planeta sino tambi&eacute;n de tu propia salud!</p>\r\n<div class=\"btnctr\"><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/ideas-para-reducir-plastico.pdf\" target=\"_blank\" rel=\"noopener\">Descargar poster</a></div>\r\n<p class=\"txtdestacadog\">Adem&aacute;s para que vayas cogiendo algunas ideas, sobre alternativas m&aacute;s sostenibles que pueden sustituir al pl&aacute;stico,&nbsp; te desafiamos a que realices este divertido juego de memoria. &iexcl;No olvides apuntar tu tiempo!</p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" src=\"https://view.genial.ly/608a5fe2ee6d090d34f2884c\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n<div class=\"btnctr\">&nbsp;</div>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/verticales-plataforma-habitat.jpg\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n</div>\r\n<!--<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" src=\"https://view.genial.ly/608a5fe2ee6d090d34f2884c\" width=\"1200px\" height=\"675px\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\">&nbsp;</div>\r\n</div>--></div>',1,'<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Empezar por lo que resulte m&aacute;s sencillo para seguir avanzando.</h4>\r\n<p>Hay tanto pl&aacute;stico a nuestro alrededor que ver&aacute;s que reducir (no eliminar) su uso es sencillo. Muchas veces cuando nos ponemos un objetivo, como por ejemplo reducir el uso de pl&aacute;stico desechable, tendemos a pensar en las dificultades en lugar de las cosas m&aacute;s sencillas. Muchas veces la respuesta es &ldquo;no podr&eacute; vivir sin este producto&rdquo;, no pasa nada, ves a por otro entonces.</p>\r\n<p>Hay tanto residuos por evitar que no tienes que quitar nada que para ti sea &ldquo;fundamental&rdquo;.<strong> Lo importante es empezar, por lo que te resulte m&aacute;s f&aacute;cil.</strong> Sin agobios. Esto no es un sacrificio. T&oacute;matelo como un juego donde la meta es el residuo cero. Puede que nunca lleguemos a &eacute;l, pero mientras avanzamos, aprendemos y nos divertimos por el camino.</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te desafiamos a qu&eacute; compartas en el muro cu&aacute;l han sido tus logros en la reducci&oacute;n de pl&aacute;stico. &iquest;Te has pasado a la bolsa reutilizable? &iquest;A la compra a granel? &iquest;Has descartado la fruta o verdura envasada en pl&aacute;stico?</p>\r\n<div style=\"width: 100%;\">\r\n<p class=\"p1\">Y sobre todo no te desanimes. &iexcl;Todo es empezar!</p>\r\n</div>\r\n<div class=\"btnctr\">&nbsp;</div>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/verticales-plataforma-habitat%20(1).gif\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n</div>\r\n<!--<div style=\"width: 100%;\">\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\">&nbsp;</div>\r\n</div>--></div>',7,0,0,1,'2021-05-05 11:33:43','2023-01-31 15:56:25'),(29,4,'La importancia de reciclar, y hacerlo bien','la-importancia-de-reciclar-y-hacerlo-bien-1','<p><span style=\"font-size: 12pt;\"> &iquest;Te surgen dudas a la hora de depositar los residuos en los contenedores de reciclaje? &iquest;Es un brick de leche pl&aacute;stico o cart&oacute;n? &iquest;Tirar&iacute;as un espejo al contenedor de vidrio? &iquest;Y una bombilla? </span></p>\r\n<p><span style=\"font-size: 12pt;\">&iquest;Eres de los que piensas que tampoco pasar&iacute;a nada si te equivocases de contenedor porque conf&iacute;as en que en la planta de reciclaje lo separar&aacute;n correctamente?</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong> Debes saber que equivocarse puede hacer m&aacute;s da&ntilde;o que bien al estar contribuyendo en gran medida a la contaminaci&oacute;n. Es exactamente lo que ocurre cuando se agrega un elemento o material incorrecto a un flujo de residuos espec&iacute;fico, en este caso el flujo de reciclaje. </strong></span></p>','<p><span style=\"font-size: 12pt;\">Cuando un lote de reciclables est&aacute; contaminado, hay una buena posibilidad de que sea rechazado y termine en el vertedero. En otras palabras, debido a ese residuo mal depositado, toneladas de art&iacute;culos correctamente reciclados pueden acabar en vertederos.</span></p>\r\n<p><span style=\"font-size: 12pt;\"> Creo que estar&aacute;s de acuerdo en que esto es una tragedia, y va completamente en contra de lo que se trata el reciclaje. </span></p>\r\n<p><span style=\"font-size: 12pt;\"> Seguramente a estas alturas ya sepas para qu&eacute; sirve cada contenedor. Hoy queremos ayudarte a que pases al siguiente nivel y te conviertas en un experimentado reciclador. </span></p>\r\n<p><span style=\"font-size: 12pt;\">&iquest;Te animas?</span></p>','<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Todos cometemos errores, lo importante es identificarlos y corregirlos.</h4>\r\n<p>En Espa&ntilde;a llevamos&nbsp;a&ntilde;os reciclando residuos. <strong>Sin embargo, hay una serie de productos que a&ntilde;o tras a&ntilde;o acaban en el contenedor equivocado.</strong> Son los denominados impropios, que provocan ineficiencias en el sistema, sobrecargas en el servicio de recogida, dificultan el tratamiento de residuos&nbsp; y, adem&aacute;s, suponen una p&eacute;rdida de materiales reciclables que se podr&iacute;an haber recuperado si se hubiesen depositado en el contenedor adecuado.</p>\r\nA continuaci&oacute;n te dejamos los m&aacute;s habituales para que tomes nota y aprendas a ser un aut&eacute;ntico reciclador.</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/errores-reciclaje.jpg\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\"><span style=\"font-size: 12pt;\">Hoy te desafiamos a que reflexiones sobre si realmente est&aacute;s reciclando correctamente, Organiza bien tu sistema de reciclaje en tu hogar y en tu lugar de trabajo y ponte manos a la obra. Adem&aacute;s te desafiamos a que realices este divertido juego que hemos preparado para que te conviertas en un experto reciclador.</span></p>\r\n<p><span style=\"font-size: 12pt;\">No olvides darle a \"aceptar\" cuando hayas terminado el juego, &iexcl;Estaremos m&aacute;s cerca de nuestro objetivo!</span></p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" src=\"https://view.genial.ly/619e7ae6c2f8590e2dd70588\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<div style=\"clear: both; margin: 40px;\">&nbsp;</div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-9\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4><span style=\"font-family: Recoleta;\">Dale la oportunidad de tener otra vida.</span></h4>\r\n<p>Cuando la reutilizaci&oacute;n del residuo no sea posible, la mejor opci&oacute;n de la que disponemos para colaborar en su correcta gestio패n es participando en la recogida selectiva. De esta forma los residuos podra패n reciclarse, es decir, transformarse de nuevo en cosas &uacute;tiles, siempre y cuando reciban la gestio패n necesaria.</p>\r\n<p><strong>Para que esto sea posible, es imprescindible que cada tipo de envase sea depositado de forma diferenciada. </strong>Si no se hace correctamente puede acabar arruinando todo un contenedor lleno de residuos. Por ejemplo Tirar un brick al contenedor azul puede estropear un metro c&uacute;bico de cart&oacute;n.</p>\r\n<p>Seguro de que a estas alturas ya est&aacute;s mucho m&aacute;s concienciado de la importancia de reciclar correctamente. Y si te asaltan dudas, no pasa nada, lo mejor es preguntar o investigar antes de cometer un error que pueda tener graves consecuencias.</p>\r\n<p><strong>DESAF&Iacute;O</strong></p>\r\n<p class=\"txtdestacadog\">Comparte con tus compa&ntilde;eros el error que estabas cometiendo hasta la fecha. &iexcl;Seguramente no eres el &uacute;nico! Tambi&eacute;n puedes aprovechar para compartir tus dudas sobre reciclaje, &iquest;Alg&uacute;n residuo que todav&iacute;a no sepas d&oacute;nde deber&iacute;a ir? Si&eacute;ntete libre de subir una foto de ese residuo del que tienes dudas todav&iacute;a de cu&aacute;l deber&iacute;a ser su contenedor.</p>\r\n</div>\r\n<div class=\"col-md-3\"><br /><img src=\"../../../../storage/files/uploads/Copia%20de%20CUADRADAS%20CONCIENCIAR.gif\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n</div>',7,0,1,1,'2021-05-05 20:35:35','2023-01-31 15:34:59'),(30,4,'La importancia de reciclar','la-importancia-de-reciclar-1','<p><span style=\"font-size: 12pt;\"> Reciclando evitamos que los productos y materiales se conviertan en residuos, transform&aacute;ndolos en otros completamente nuevos,&nbsp;alargando su vida &uacute;til y ayudando a la preservaci&oacute;n de los recursos naturales del planeta.</span></p>\r\n<p><strong><span style=\"font-size: 12pt;\"> El reciclaje forma parte de la Econom&iacute;a Circular, el modelo basado en aprovechar al 100% las materias primas, haciendo m&aacute;s eficientes los procesos de uso y fabricaci&oacute;n.</span></strong></p>\r\n<p><span style=\"font-size: 12pt;\">&iquest; Un aspecto fundamental para comenzar a reciclar, y para comenzar a incorporar el reciclaje como un h&aacute;bito en la rutina de tu hogar, es el de que tanto tu c&oacute;mo todos los integrantes de tu familia o de tu hogar est&eacute;is concienciados acerca de la importancia de esta pr&aacute;ctica. </span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>Puede que a estas alturas el proceso de reciclar ya forme parte de tu d&iacute;a a d&iacute;a. Tanto si llevas a&ntilde;os separando debidamente tus residuos como si todav&iacute;a est&aacute;s en un momento muy incipiente, queremos acabar de convencerte de que RECICLAR es la elecci&oacute;n correcta si te preocupa el futuro de nuestro planeta.</p>\r\n<p>Para ello el primer paso es entender e integrar los grandes beneficios que obtenemos reciclando.</p>\r\n<ul>\r\n<li><strong>Ahorro de energ&iacute;a. </strong>Al reciclar se reduce el consumo de energ&iacute;a que se necesita para obtener las materias primas directamente de la naturaleza, as&iacute; como para su transporte y transformaci&oacute;n.</li>\r\n<li><strong>Disminuci&oacute;n de la contaminaci&oacute;n. </strong>Al reciclar los desechos dom&eacute;sticos y los residuos industriales se disminuye la cantidad de basura y desechos que acaban cayendo en fuentes de agua, en el suelo y/o generando gases t&oacute;xicos.</li>\r\n<li><strong>Ahorro de recursos naturales. </strong>Como se estar&aacute; reciclando y reutilizando, no har&aacute; falta utilizar m&aacute;s recursos naturales para la elaboraci&oacute;n de nuevos productos.</li>\r\n</ul>\r\n<p class=\"txtdestacadog\">Si queremos dejar un buen legado, no podemos esperar a que los dem&aacute;s hagan las cosas por nosotros. El momento de ocuparnos es hoy.&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-4\">&nbsp;</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Reciclar &iexcl;S&iacute; que sirve!</h4>\r\n<p>Aunque parezca mentira, todav&iacute;a muchas personas que se muestran esc&eacute;pticas acerca de los beneficios que se consiguen a partir del reciclaje dom&eacute;stico. Y necesitamos que todo el mundo tome consciencia de que el reciclaje contribuye considerablemente a evitar el&nbsp;deterioro del planeta&nbsp;por sobre producci&oacute;n.</p>\r\n<p><strong>La destrucci&oacute;n de gran cantidad de bosques o el deterioro progresivo de la capa de ozono ocurren fundamentalmente por la intenci&oacute;n de producir muy por encima de las necesidades de las personas. </strong>El reciclaje es una opci&oacute;n para disminuir esa situaci&oacute;n, y permitir&iacute;a ahorrar gran cantidad de la energ&iacute;a que se utiliza para esos fines.</p>\r\n<p>Por ello hoy queremos que reflexiones, &iquest;Eres consciente de todo lo que consigues reciclando todos tus residuos debidamente cada d&iacute;a? O por el contrario &iquest;Sabes lo mucho que est&aacute;s perjudicando a nuestro planeta si no lo haces?</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te animamos a que tomes conciencia de lo que consigues cada vez que depositas un residuo en su contenedor adecuado. Sit&uacute;a el rat&oacute;n encima de cada residuo, y descubre lo que consigues si lo reciclas debidamente o lo que ocurre por el contrario si no lo haces.&nbsp;</p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"LA IMPORTANCIA DE RECICLAR (CONCIENCIAR)\" src=\"https://view.genial.ly/626b98c7aab20100171352be\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/7%20(2).png\" alt=\"\" width=\"540\" height=\"540\" /></div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\"><img style=\"float: left;\" src=\"../../../../storage/files/uploads/importancia-de-reciclar-colectivo.gif\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Cada vez que reciclas, le est&aacute;s dando un poco m&aacute;s de vida al planeta</h4>\r\n<p>Cada a&ntilde;o aumenta la cantidad de residuos que generamos: en los &uacute;ltimos 40 a&ntilde;os se ha producido m&aacute;s basura en el mundo que desde el origen del hombre hasta 1970.</p>\r\n<p><span style=\"font-size: 12pt;\"> Tenemos la certeza que despu&eacute;s de interiorizar todo lo que se consigue reciclando encontrar&aacute;s m&aacute;s sentido a la costumbre de reciclar.</span></p>\r\n<p>Aqu&iacute; tienes unos cu&aacute;ntos datos m&aacute;s para acabar de convencerte:</p>\r\n<ul>\r\n<li>Si tan s&oacute;lo 100.000 personas eliminaran sus nombres de los listados de publicorreo podr&iacute;amos salvar 150.000 &aacute;rboles cada a&ntilde;o, y si lo hiciera un mill&oacute;n de personas podr&iacute;amos salvar 1,5 millones de &aacute;rboles.</li>\r\n<li>Por <strong>cada tonelada de vidrio reciclado</strong> se ahorran 130 kilos de combustible y 1.200 de materia prima.</li>\r\n<li>El <strong>aluminio que no se recicla</strong> y se dispersa por el medio <strong>permanece un m&iacute;nimo de 500 a&ntilde;os.</strong></li>\r\n<li>Con <strong>40 botellas de pl&aacute;stico transparentes recicladas</strong> se puede fabricar un forro polar.</li>\r\n<li>Con <strong>80 latas de refresco </strong>se puede fabricar una llanta de una bicicleta.</li>\r\nEsto son s&oacute;lo algunos ejemplos de lo que se puede conseguir.</ul>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Ahora cu&eacute;ntanos a trav&eacute;s del muro si reciclas en casa, puedes tambi&eacute;n subir una foto del residuo que m&aacute;s reciclas. &iexcl;Adem&aacute;s menciona a aquel compa&ntilde;ero de trabajo que crees que es un &ldquo;Experto/a Reciclador/a&rdquo;!</p>\r\n&iexcl;S&uacute;mate a la lucha y recicla!\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>',7,0,1,1,'2021-05-07 08:52:48','2023-01-31 15:17:52'),(31,4,'Reciclar y Reciclarse','reciclar-y-reciclarse-1','<p><span style=\"font-size: 12pt;\"> El reciclaje es el proceso de recolecci&oacute;n y transformaci&oacute;n de materiales para convertirlos en nuevos productos, con el objetivo de que sigan teniendo una utilidad pr&aacute;ctica para la sociedad.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Hoy queremos abordar el reciclaje desde otra perspectiva. El mundo y las personas estamos en constante cambio y debemos avanzar, estudiar, reciclarnos, y adaptarnos.</span></p>\r\n<p><strong><span style=\"font-size: 12pt;\">Los humanos inconscientemente estamos sumergidos en un aprendizaje constante, somos curiosos por naturaleza, pero a veces tendemos a dejar que la pereza invada nuestras costumbres y h&aacute;bitos.</span></strong></p>\r\n<p><span style=\"font-size: 12pt;\">Hoy hablamos de esto precisamente, de mantener el inter&eacute;s por continuar aprendiendo o lo que es lo mismo, de reciclarnos y adaptarnos a las circunstancias.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>Es importante nunca dejar de tener ganas de adquirir nuevos conocimientos, preguntar, investigar, leer, escuchar, para seguir creciendo como persona en el &aacute;mbito personal y tambi&eacute;n profesional.</p>\r\n<p>Hay infinitas cosas que uno puede seguir aprendiendo a lo largo de toda su vida, el aprendizaje nos permite reinventarnos para poder estar listos en el momento en el que m&aacute;s lo necesitemos.</p>\r\n<p class=\"txtdestacadog\">Qui&eacute;n quiere aprender no encuentra excusas, aprende de cada oportunidad que se le plantea en la vida, o incluso aprende a crear esas oportunidades</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Aprender para avanzar y mejorar.</h4>\r\n<p>Aprender para descartar, para no volver donde no quieres estar,&nbsp;aprender para descubrir nuevas metas, desaf&iacute;os, oportunidades. Aprender para cada d&iacute;a ser una mejor versi&oacute;n de ti.</p>\r\n<p>Tambi&eacute;n en materia medioambiental, a trav&eacute;s de esta plataforma, a lo largo de estos meses, hemos querido que adquirieras nuevos conocimientos sobre algo tan importante como es la salud y el cuidado de nuestro planeta.</p>\r\n<p>Dentro de poco llegar&aacute;n el momento de desconectar, las vacaciones son muchas veces un momento de reflexi&oacute;n, en el que aprovechamos para reflexionar sobre qu&eacute; nuevos retos o prop&oacute;sitos vamos a adoptar a la vuelta a la rutina. El aprendizaje sin duda, deber&iacute;a ser uno de esos buenos prop&oacute;sitos.</p>\r\n<p>No hace falta proponernos grandes aprendizajes, retos inalcanzables. Peque&ntilde;os avances que me aporten m&aacute;s seguridad y conocimiento en ese tema que tanto me interesa y que adem&aacute;s me ayude a mantenerme activo intelectualmente.</p>\r\n<p class=\"txtdestacadog\">Hoy te retamos a que reflexiones acerca de los nuevos aprendizajes que piensas abordar en un futuro pr&oacute;ximo.&nbsp; Imprime esta&nbsp; plantilla y apunta tus pr&oacute;ximos prop&oacute;sitos o aquello en lo que quieres aprender o profundizar m&aacute;s. &iexcl;No olvides que nunca es tarde para empezar un nuevo aprendizaje!</p>\r\n<p><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/mis-objectivos.pdf\">PLANTILLA</a></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/reciclarse.gif\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>El saber no ocupa lugar</h4>\r\n<p>A veces nos sumergimos en la rutina y olvidamos de la importancia de seguir aprendiendo a lo largo de toda nuestra vida. &ldquo;No tengo tiempo&rdquo;, &ldquo;Estoy muy ocupado&rdquo;, &ldquo;Lo intento el mes que viene&rdquo; &hellip; &iquest;Te suena? Y as&iacute; se nos pasan los a&ntilde;os.</p>\r\n<p>Pero si quieres ir hacia adelante, m&aacute;rcate un prop&oacute;sito y/o varios prop&oacute;sitos personales y profesionales, y planifica de qu&eacute; manera vas a conseguirlos.</p>\r\n<p>Es una cuesti&oacute;n de enfoque, donde necesitas priorizar lo que verdaderamente vale la pena para tu vida. Priorizar el aprendizaje debe ser algo imprescindible porque significa que est&aacute;s comprometido contigo mismo a ser una mejor versi&oacute;n de ti de la que eras ayer y que quieres a&ntilde;adir m&aacute;s valor, ya sea para generar un mayor impacto en tu negocio, trabajo o simplemente en quienes est&aacute;n a tu alrededor.</p>\r\nDefine un plan acorde a tus necesidades ya que cada persona es diferente y aprende de manera distinta. Convierte cualquier situaci&oacute;n en una oportunidad de aprendizaje. No olvides que la formaci&oacute;n continua est&aacute; relacionada con la autoestima, el control de las situaciones, la gesti&oacute;n de los conflictos y la toma de mejores soluciones.\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Comparte con tus compa&ntilde;eros sobre qu&eacute; quieres enfocar tu aprendizaje. &iquest;Un nuevo idioma? &iquest;Un deporte? &iquest;Ampliar tus conocimientos sobre una materia en concreto? Si quieres tambi&eacute;n puedes subir una imagen que haga m&aacute;s visual y real el aprendizaje que te has marcado.</p>\r\n<p>Estamos seguros de que conseguir&aacute;s lo que te propongas, no olvides que el hecho de compartirlo te acerca un poco m&aacute;s al objetivo que te has marcado.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/reciclarse-2.gif\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>',7,0,1,1,'2021-05-07 09:38:36','2022-07-14 05:31:54'),(32,2,'Sin agua no hay vida','sin-agua-no-hay-vida-1','<p><span style=\"font-size: 12pt;\"> El agua es un recurso ilimitado y muy valioso adem&aacute;s de indispensable para nuestra supervivencia </span></p>\r\n<p><span style=\"font-size: 12pt;\">Resulta fundamental para la vida no s&oacute;lo para el consumo humano, sino tambi&eacute;n para todos los seres vivos del planeta. En las &uacute;ltimas d&eacute;cadas el nivel de consumo ha experimentado un crecimiento muy superior a la capacidad natural de regeneraci&oacute;n del agua.</span></p>\r\n<p><strong><span style=\"font-size: 12pt;\"> Toca tomar conciencia de lo que est&aacute; pasando y empezar a tomar medidas que empiecen por hacer un uso m&aacute;s responsable de este recurso.</span></strong></p>','<p><span style=\"font-size: 12pt;\"> Todos, de manera individual o colectiva debemos empezar a cuidar, valorar y racionar el agua que utilizamos en nuestras m&uacute;ltiples actividades diarias.</span></p>\r\n<p><span style=\"font-size: 12pt;\">El 70% del planeta es agua, pero no toda ella es consumible. Hay que distinguir entre el&nbsp;agua potable&nbsp;y el&nbsp;agua no potable. En muchos lugares existe escasez de este recurso o bien el agua est&aacute; contaminada y no existe una&nbsp;red de distribuci&oacute;n&nbsp;o los sistemas necesarios para convertirla en agua consumible.</span></p>\r\n<p class=\"txtdestacadog\"><span style=\"font-size: 12pt;\"> Se estima que todos los d&iacute;as mueren cerca de 4.000 ni&ntilde;os debido a enfermedades que est&aacute;n provocadas por la&nbsp;falta de acceso al agua potable&nbsp;o por unos sistemas de saneamiento ineficientes.</span></p>\r\n<p><span style=\"font-size: 12pt;\"> Pero la falta de agua tambi&eacute;n afecta a animales y plantas, que tambi&eacute;n enferman y mueren. Adem&aacute;s, afecta enormemente a la tierra: si no hay agua los cultivos se secan y no producen alimentos, lo que puede desembocar en falta de alimentos para cubrir las necesidades de la poblaci&oacute;n, y si la escasez se mantiene en el tiempo la tierra se puede llegar a secar y convertirse en terreno no f&eacute;rtil.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Reduce el consumo de agua en tu hogar</h4>\r\n<p>Las personas podemos llegar a utilizar al menos 100 litros de&nbsp;agua potable&nbsp;en un d&iacute;a para alimentarnos, ducharnos e hidratarnos, pero tambi&eacute;n utilizamos el agua para regar y muchas industrias y f&aacute;bricas necesitan el agua para sus procesos, devolvi&eacute;ndola al medio ambiente como&nbsp;agua contaminada. .</p>\r\n<p><strong>Cada espa&ntilde;ol gasta en su hogar&nbsp;m&aacute;s de 130 litros de agua al d&iacute;a. </strong>Una cifra bastante elevada teniendo en cuenta que hay millones de personas que no tienen acceso a ella. El ahorro de agua es una tarea indispensable que tenemos pendiente, y es que no solo beneficia a nuestro bolsillo: tambi&eacute;n contribuiremos al mantenimiento de nuestro planeta.&nbsp;</p>\r\n<p>Hoy te desafiamos a que reflexiones sobre tu consumo de agua. Seguro que puedes hacer muchas cosas para reducirlo.</p>\r\n<p><span style=\"font-size: 12pt;\"> El consumo de&nbsp;agua&nbsp;en una&nbsp;ducha&nbsp;promedio de diez minutos&nbsp;se&nbsp;extiende a los 200 litros de&nbsp;agua&nbsp;por&nbsp;ducha, lo que&nbsp;se&nbsp;traduce en que, cada minuto que pasa nuestro grifo abierto, gastamos unos 20 litros. <strong>La ducha diaria no deber&iacute;a excederse de cinco minutos&nbsp;para un uso sostenible de agua y energ&iacute;a que no supere los 95 litros de agua de consumo medio diario.</strong> Para coger esa rutina puedes ponerte un cron&oacute;metro, o un reloj de arena o tambi&eacute;n puedes ponerte m&uacute;sica, ya que una ducha no deber&iacute;a durar m&aacute;s de una canci&oacute;n. Adem&aacute;s de controlar el consume estar&aacute;s consiguiendo que tu ducha resulte mucho m&aacute;s placentera, &iquest;No crees?</span></p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Descarga este pdf con 10 pr&aacute;cticos consejos para reducir el consumo de agua en tu hogar. Ponlo &nbsp;en un lugar visible para todos los integrantes de tu hogar. Para que todos empec&eacute;is a tomar conciencia.</p>\r\n<div class=\"btnctr\"><a class=\"btn btn-primary\" title=\"Consejos para reducir el consumo de agua\" href=\"../../../../storage/files/uploads/consejos-reducir-agua.pdf\" target=\"_blank\" rel=\"noopener\">Descargar PDF</a></div>\r\n<p class=\"txtdestacadog\">Para terminar, realiza este divertido juego de canciones. &iexcl;Puede que te sirvan de inspiraci&oacute;n para crear tu propia lista de canciones para la ducha!</p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"ADIVINA LA CANCI&Oacute;N (CONCIENCIAR)\" src=\"https://view.genial.ly/63ce56fa28d4750019212e2d\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/video-agua.gif\" alt=\"\" width=\"501\" height=\"620\" /></div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\"><img style=\"float: left;\" src=\"../../../../storage/files/uploads/verticales-concienciar.png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Ahorremos agua hoy, para que no nos falte ma&ntilde;ana.</h4>\r\n<p>Una de las consecuencias m&aacute;s evidentes del cambio clim&aacute;tico es que cada vez llueve menos en determinadas zonas, adem&aacute;s son muchos los r&iacute;os que han visto disminuido su caudal , por lo que ya no podemos considerar que el agua es un&nbsp;bien ilimitado&nbsp;y muchas personas en el mundo no tienen acceso a&nbsp;agua limpia.</p>\r\nSi has aceptado el desaf&iacute;o individual significa que est&aacute;s de acuerdo en las medidas que recomendamos para controlar el gasto de agua en tu hogar. No se trata de comenzar a aplicar todo de golpe, se trata de comenzar por algo y luego continuar. Hoy te desafiamos a que te hagas la siguiente pregunta &iquest;Por d&oacute;nde puedo yo comenzar a controlar mi exceso de consumo de agua?\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Comparte en el muro,<strong> </strong>la medida que ya estabas aplicando en tu hogar para controlar el gasto de agua y la medida que vas a empezar a aplicar a partir de ahora.</p>\r\n<p class=\"txtdestacadog\">Comparte tambi&eacute;n tu canci&oacute;n favorita para escuchar mientras te duchas, &iexcl;Recuerda con una canci&oacute;n tienes tiempo suficiente!</p>\r\n</div>\r\n</div>',7,0,1,1,'2021-05-17 07:39:57','2023-02-07 08:51:32'),(33,3,'Reutiliza y estimula tu creatividad','reutiliza-y-estimula-tu-creatividad','<p><span style=\"font-size: 12pt;\">Viendo a los ni&ntilde;os jugar nos sorprende lo creativos que son y lo lejos que puede llegar su imaginaci&oacute;n. La creatividad fluye de un modo natural cuando somos ni&ntilde;os, sin embargo parece que a medida que nos vamos haciendo mayores perdemos ese don innato.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong>La buena noticia es que la creatividad se puede estimular para que con el paso de los a&ntilde;os no vaya desapareciendo.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">El Upcycling, es tambi&eacute;n conocido como reutilizaci&oacute;n creativa, consiste en la transformaci&oacute;n de un objeto no deseado, o destinado a ser un residuo, en nuevos productos de mejor calidad, distinta utilidad o con mayor valor ambiental.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Hoy te proponemos que estimules tu creatividad mientras cuidas del planeta , busca una alternativa para aquellos residuos o objetos que pensabas desechar.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p><span style=\"font-size: 12pt;\">El Upcycling es una estupenda manera de ejercitar tu creatividad, ideando distintas maneras para reutilizar objetos, y darles una segunda vida.</span></p>\r\n<p class=\"txtdestacadog\"><span style=\"font-size: 12pt;\">Revivir distintos art&iacute;culos que ya se han desechado y convertirlos en tus peque&ntilde;as e ingeniosas &ldquo;obras de arte&rdquo; es una divertida manera de contribuir con el medio ambiente (y con tu bolsillo tambi&eacute;n).</span></p>\r\n<p><span style=\"font-size: 12pt;\">Seg&uacute;n la Comisi&oacute;n Europea, en Europa utilizamos 16 toneladas de materia prima por persona y a&ntilde;o, de los cuales 6 toneladas se transforman en residuos. &iquest;Y si cada uno de nosotros intentase que una parte de esos residuos fueran puestos de nuevo en circulaci&oacute;n? &iquest;No crees que ser&iacute;a una buena opci&oacute;n?</span></p>\r\n<p>&nbsp;</p>','<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Pi&eacute;nsalo dos veces antes de desechar un objeto o residuo</h4>\r\n<p>Crear algo con nuestra propias &nbsp;manos, utilizando nuestra mente y poniendo nuestra creatividad en ello consigue m&uacute;ltiples beneficios . &iquest;Quieres saber cu&aacute;les?</p>\r\n<ul>\r\n<li>Aumenta tu autoestima&nbsp;</li>\r\n<li><span style=\"font-size: 12pt;\">Ayuda a disminuir el estr&eacute;s o &nbsp;ansiedad</span></li>\r\n<li><span style=\"font-size: 12pt;\">Ejercita la mente y la capacidad de concentraci&oacute;n</span></li>\r\n<li><span style=\"font-size: 12pt;\">Estimula tu felicidad&nbsp;</span></li>\r\n<li><span style=\"font-size: 12pt;\">Favorece tu psicomotricidad fina</span></li>\r\n<li><span style=\"font-size: 12pt;\">Potencia tu creatividad</span></li>\r\n<li><span style=\"font-size: 12pt;\">Genera un impacto positivo en la sociedad y en el planeta</span></li>\r\n</ul>\r\n<p>Hoy te animamos a que busques entre todos aquellos objetos de los que pensabas deshacerte, dedica un tiempo a pensar que podr&iacute;as hacer con ellos. Estimula tu creatividad pensando en otras vidas o usos para esos art&iacute;culos o residuos. Puede que al principio te resulte dif&iacute;cil pero con el tiempo y la costumbre pasar&aacute; a ser algo habitual.</p>\r\n<p>Sino te surgen esas ideas y necesitas un poco de inspiraci&oacute;n para estimular tu creatividad accede a este link. &iexcl;Te sorprender&aacute; todo lo que puedes llegar a hacer!</p>\r\n<p>Realmente podemos darle una nueva vida a casi cualquier objeto que tengamos por casa y que vayamos a tirar. &iexcl;Solo hace falta un poco de imaginaci&oacute;n y creatividad.</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te animamos a que estimules tu creatividad practicando la t&eacute;cnica de la reutilizaci&oacute;n o upcycling, adem&aacute;s accede a este<strong> divertido juego donde tendr&aacute;s que adivinar a partir de que residuo est&aacute;n creados estos objetos.</strong></p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"INSPIRACI&Oacute;N UPCYCLING (CONCIENCIAR)\" src=\"https://view.genial.ly/63cfa9fe1b08c400124abde4\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n<p class=\"txtdestacadog\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/video-desafio-individual.gif\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n</div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\"><img style=\"float: left;\" src=\"../../../../storage/files/uploads/creatividad-colectivo.jpg\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Todos somos creativos</h4>\r\n<p>Aunque no lo creas, todos somos creativos. La creatividad es parte de nosotros, surge en nuestro cerebro, nos libera y tambi&eacute;n nos ayuda muchas veces a encontrar la soluci&oacute;n a un problema.</p>\r\n<p>A veces nos limitamos a pensar que la creatividad se encuentra &uacute;nicamente en aquellos que destaquen en actividades art&iacute;sticas, de dise&ntilde;o o manuales, sin embargo la creatividad forma parte de nuestro d&iacute;a a d&iacute;a, est&aacute; en tu manera de vestirte, de cocinar, de ambientar tu hogar, en tu manera de expresarte o de enfrentarte a los problemas entre muchas otras cosas.</p>\r\n<p>Todos sin excepci&oacute;n tenemos la capacidad de ser creativos, sin embargo, es cierto tambi&eacute;n que no todo el mundo tiene la misma capacidad de crear o de imaginar tambi&eacute;n es cierto que hay personas capaces de innovar o de ser m&aacute;s creativos en un &aacute;mbito que en otro.&nbsp;</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te animamos a que compartas en el muro en qu&eacute; aspectos o situaciones de tu vida consideras qu&eacute; eres creativo, &iexcl;Adem&aacute;s puedes compartir una foto de una de tus creaciones o una foto tuya realizando esa actividad!</p>\r\n<p>Una cosa es cierta, la creatividad hay que trabajarla y regarla todos los d&iacute;as. &iquest;No crees?</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>',7,0,1,1,'2021-05-26 10:46:05','2023-01-31 15:50:32'),(34,1,'춰Movil칤zate!','movilizate','<p><span style=\"font-size: 12pt;\"> En Espa&ntilde;a, los h&aacute;bitos actuales de movilidad urbana se caracterizan por una expansi&oacute;n urbana continua y una dependencia muy alta de los coches. La movilidad sostenible nace en este contexto para reducir los impactos negativos asociados a la creciente movilidad urbana y promover modos de transporte m&aacute;s ecol&oacute;gicos.</span></p>\r\n<p><span style=\"font-size: 12pt;\"> El aumento de las emisiones de gases de&nbsp;efecto invernadero&nbsp;provocados por el transporte preocupa cada vez m&aacute;s, especialmente en las ciudades, donde los &iacute;ndices de contaminaci&oacute;n atmosf&eacute;rica empiezan a ser considerados como un riesgo para la salud p&uacute;blica.</span></p>\r\n<p><strong><span style=\"font-size: 12pt;\"> La movilidad sostenible contribuye a&nbsp;reducir las emisiones nocivas, y por lo tanto, a&nbsp;disminuir la contaminaci&oacute;n atmosf&eacute;rica&nbsp;y&nbsp;mejorar la calidad del aire&nbsp;en las ciudades.</span></strong></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>La movilidad sostenible se caracteriza por el conjunto de desplazamientos que se realizan con la finalidad de recorrer la distancia desde el lugar de origen hasta el de destino&nbsp;reduciendo los impactos negativos en el medio ambiente. Se trata tanto del transporte p&uacute;blico (autobuses el&eacute;ctricos o cero emisiones, metro, tren, tranv&iacute;a, etc.) como del privado (peatonal, bicicleta, patinete o veh&iacute;culo el&eacute;ctrico, etc.).</p>\r\n<p>Desde Habitat hemos querido transmitirte, a lo largo de estos meses, la importancia de movilizarnos de una manera m&aacute;s sostenible y tambi&eacute;n aplicar medidas que consigan reducir nuestro impacto sobre el medio ambiente, y en este desaf&iacute;o, el &uacute;ltimo de la plataforma, queremos justamente, profundizar un poco m&aacute;s sobre este tema.</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Movilidad sostenible. H&aacute;bitos para adoptar en nuestro d&iacute;a a d&iacute;a.</h4>\r\n<p>Seg&uacute;n la Agencia Europea de Medio Ambiente (AEMA), el transporte es&nbsp;una tercera parte de toda la energ&iacute;a que se consume en la Uni&oacute;n Europea. La mayor parte de esta energ&iacute;a procede del petr&oacute;leo, lo que significa que el transporte es responsable de una gran parte de las emisiones de gases de efecto invernadero de la UE, contribuyendo significativamente al&nbsp;calentamiento global&nbsp;y a la contaminaci&oacute;n atmosf&eacute;rica.</p>\r\n<p><strong>El espa&ntilde;ol medio emite cada a&ntilde;o 7,15 toneladas de CO2eq, de los cuales&nbsp;18% procede del transporte, o sea casi&nbsp;1,3 toneladas de CO2eq.</strong></p>\r\n<p>La cantidad media de emisiones de CO2 por kil&oacute;metro depende del&nbsp;modo de transporte, el&nbsp;n&uacute;mero de pasajeros&nbsp;y la&nbsp;distancia recorrida.&nbsp;Por supuesto, dejar de viajar no es una opci&oacute;n. Sin embargo, cambiar nuestros h&aacute;bitos de viaje puede tener m&uacute;ltiples beneficios: menos emisiones de CO2, menos costes e incluso menos estr&eacute;s y fatiga.</p>\r\n<p>A continuaci&oacute;n te animamos a que mires este v&iacute;deo, ver&aacute;s todo lo que puedes hacer al respecto. Adem&aacute;s sigue leyendo y obtendr&aacute;s toda una lista de medidas que puedes empezar a aplicar para reducir tu huella de carbono a la hora de desplazarte.</p>\r\n<p style=\"margin: 13.5pt 0cm 0cm; font-size: 12pt; font-family: \'Times New Roman\', serif; color: #000000; text-align: justify; line-height: 18.4px;\"><span lang=\"ES-TRAD\" style=\"font-family: Cambria, serif;\">&nbsp;<video autoplay=\"autoplay\" controls=\"controls\" width=\"840\" height=\"420\">\r\n&gt; source src=\"../../../../storage/files/uploads/LA%20NATURALEZA%20NOS%20ESTA%CC%81%20AVISANDO%20(2).mp4\" type=\"video/mp4\" /&gt;<source src=\"../../../../storage/files/uploads/VIDEO%20MOVILIDAD.mp4\" type=\"video/mp4\" /></video></span></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Prioriza ir a pie.</strong> Evita el coche, si te suponen 20 minutos caminando, ya que es un tiempo m&aacute;s que razonable (algo m&aacute;s de 1,6 km) sabiendo que la OMS aconseja al menos 30 minutos de actividad f&iacute;sica al d&iacute;a.</li>\r\n<li><strong>Un paseo de&nbsp;30 minutos en bicicleta</strong>&nbsp;(es decir, 9 km) puede servir para hacer la compra o ir al trabajo.</li>\r\n<li><span style=\"font-size: 12pt;\"><strong>Siempre que se pueda, transporte p&uacute;blico.</strong> El tren, el metro o el autob&uacute;s ayudan a reducir la&nbsp;contaminaci&oacute;n&nbsp;de las ciudades, ya que lo usan muchas personas, pero no genera tanta poluci&oacute;n como si se desplazasen en su coche privado. Para desplazamientos largos, tren mejor que avi&oacute;n: 2 horas en tren para un viaje de negocios&nbsp;y&nbsp;4 horas en tren para un viaje de fin de semana&nbsp;son m&aacute;s econ&oacute;micas y ecol&oacute;gicas que el avi&oacute;n.&nbsp;</span></li>\r\n</ul>\r\n<p>&iquest;Te resulta imposible prescindir del coche? Piensa en limitar tu impacto medioambiental adoptando buenos h&aacute;bitos:</p>\r\n<ul>\r\n<li><strong>No dejes el coche en marcha.</strong> Si vamos a parar durante m&aacute;s de un minuto conviene detener el motor para dejar de emitir gases.</li>\r\n<li><strong>Revisa el tubo de escape y el catalizador</strong>. Una mala combusti&oacute;n del motor puede producir mayor cantidad de humo y contaminaci&oacute;n.</li>\r\n<li><strong>No corras. </strong>Moderar la velocidad es una buena soluci&oacute;n. Es conveniente evitar los acelerones, como cuando salimos de un sem&aacute;foro o queremos&nbsp;hacer un adelantamiento.</li>\r\n<li><strong>Usa las marchas adecuadas. </strong>Cambiar progresivamente las marchas, e intentar evitar &nbsp;revolucionar el motor m&aacute;s de la cuenta. Es preferible circular con marchas largas y con las revoluciones bajas.</li>\r\n<li><strong>Comprueba la bater&iacute;a y los sistemas de encendido.</strong> Deben estar en buenas condiciones, ya que son los que proporcionan al motor una combusti&oacute;n mucho m&aacute;s eficaz. Precisamente los combustibles mal quemados son los principales causantes de la contaminaci&oacute;n.</li>\r\n<li><strong>Comparte coche.</strong> Se trata de una de las mejores opciones para descontaminar las ciudades porque se reduce el n&uacute;mero de coches soltando humo en nuestras ciudades. Puedes compartir tu coche con tus compa&ntilde;eros de trabajo, y tambi&eacute;n optar por un servicio de alquiler por tiempo de coche el&eacute;ctrico.</li>\r\n<li><strong>Planifica bien la ruta.</strong> Elegir la v&iacute;a m&aacute;s corta y la menos congestionada ayudar&aacute; sin duda a reducir la emisi&oacute;n de gases.</li>\r\n<li><strong>Limita el uso de aire acondicionado.&nbsp;</strong>El&nbsp;aire acondicionado gasta un 20% m&aacute;s de combustible,&nbsp;por lo que conviene tenerlo apagado en momentos en los que no es tan necesario.</li>\r\n<li><strong>Revisa las ruedas.</strong>&nbsp;Tanto la presi&oacute;n de los neum&aacute;ticos, como el estado de la banda de rodadura y la profundidad del dibujo de la misma&nbsp;, influyen directamente en el consumo total de un veh&iacute;culo.&nbsp;</li>\r\n<li><strong>Evitar el exceso de equipaje.&nbsp;</strong>No conviene sobrecargar el coche, ni mucho menos utilizar el maletero como lugar de almacenaje, ya que por cada 100 kilos de peso extra se incrementa el gasto de combustible un 5%. Por otra parte, llevar puesta la baca (si no se usa) supone tambi&eacute;n un consumo de combustible innecesario.</li>\r\n<li><strong>Prioriza la sostenibilidad a la hora de comprarte un coche. </strong>Puedes mirar variables como veh&iacute;culos que usen&nbsp;carburantes alternativos m&aacute;s sostenibles, coches el&eacute;ctricos&hellip; La sostenibilidad debe ser clave en tu proceso de compra, no solo por el planeta sino porque la legislaci&oacute;n va a ser cada vez m&aacute;s dura con la contaminaci&oacute;n.\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te retamos a que reflexiones acerca de todo lo que puedes hacer para reducir tu huella de carbono a la hora de desplazarte de un sitio a otro. Adem&aacute;s realizar este divertido cuestionarios sobre movilidad y pon a prueba tus conocimientos.</p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" src=\"https://view.genial.ly/62d12eee5a78870018cf7e2d\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>&iexcl;Movil&iacute;zate! Y contagia a tu entorno de tus buenos h&aacute;bitos.</h4>\r\n<p>La Plataforma Concienciar ha llegado a su fin. Esperamos que esta iniciativa haya servido para que seas m&aacute;s consciente de todo lo que puedes hacer en tu d&iacute;a a d&iacute;a, deseamos haber cumplido con el objetivo de hacerte reflexionar sobre aquello en lo que puedes cambiar o mejorar. D&aacute;ndote cuenta de que merece la pena llevar una estilo de vida m&aacute;s sostenible, y sobre todo de que &iexcl;No es tan complicado!</p>\r\n<p><strong>Se trata de encontrar la f&oacute;rmula que mejor se adapta a tu estilo de vida e ir incorporando peque&ntilde;os cambios y h&aacute;bitos en tu rutina. </strong>Hemos puesto en tus manos el conocimiento necesario para tomar las mejores decisiones.</p>\r\n<p>Es como una carrera de fondo en la que siempre puedes avanzar un poco m&aacute;s. Siempre podr&aacute;s darle una vuelta de tuerca m&aacute;s, piensa qu&eacute; otras cosas podr&iacute;as comenzar a implementar, aunque ahora te parezcan imposibles, seguro que si miras atr&aacute;s te parezca imposible todo lo que has conseguido hasta la fecha.</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Como &uacute;ltimo desaf&iacute;o, queremos animarte a que compartas qu&eacute; nueva iniciativa vas a poner en pr&aacute;ctica a corto-medio plazo, sobre todo lo que hemos trabajado a lo largo de estos meses.</p>\r\n<p>No queremos irnos sin antes recordarte que todos somos&rdquo; influencers&rdquo; de nuestro entorno, compartiendo, demostrando y aplicando nuestras nuevas costumbres delante de nuestros amigos, compa&ntilde;eros y familiares, conseguiremos contagiar y animar a que m&aacute;s gente tome el camino correcto. Ya que todos somos parte del cambio. y por tanto responsables del futuro de planeta.</p>\r\n<div style=\"width: 100%;\">&nbsp;</div>\r\n<div class=\"btnctr\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/b-2.jpg\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>',7,0,1,1,'2021-07-03 14:17:25','2022-07-28 11:21:53'),(35,1,'Conecta con la naturaleza en tu d칤a a d칤a','conecta-con-la-naturaleza-en-tu-dia-a-dia-1','<p><span style=\"font-size: 12pt;\"> Entrar en contacto con la naturaleza es una necesidad casi vital para los seres humanos. <strong>La naturaleza est&aacute; cada d&iacute;a en tu vida, solo tienes que sentirla.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\"> Que vivamos en n&uacute;cleos urbanos, que tengamos poco tiempo o que trabajemos mucho no son excusas v&aacute;lidas para renunciar a disfrutar cada d&iacute;a, sin excepciones, de ella. <strong>Cada d&iacute;a conecta 5/10 minutos, debes encontrar ese momento.</strong></span></p>\r\n<p><strong><span style=\"font-size: 12pt;\"> Nuestra salud f&iacute;sica y mental necesita de estos escenarios porque pocas cosas son m&aacute;s sanadoras que la visita a un lugar remoto en la naturaleza.</span></strong></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>Disfrutar de la naturaleza a diario, el mayor tiempo que nos sea posible, nos reporta enormes beneficios para nuestra salud y para nuestro estado de &aacute;nimo. Sin embargo, a veces sucede, que nos olvidamos de lo realmente beneficiosa que resulta para nosotros.</p>\r\n<p>La conexi&oacute;n con la naturaleza nos aporta aspectos f&iacute;sicos, ya que nos ayuda a oxigenar nuestro cuerpo y a reducir el cortisol, reforzando as&iacute; nuestro sistema inmunitario y todas las afecciones relacionadas con el estr&eacute;s. Tambi&eacute;n se ha demostrado que ayuda a reducir la ansiedad, tristeza y depresi&oacute;n adem&aacute;s de estimular nuestra creatividad.</p>\r\n<p><strong>&iquest;Has sentido alguna vez que est&aacute;s bloqueado en alguna cuesti&oacute;n y que al salir a dar un paseo surgi&oacute; la soluci&oacute;n al problema? Tu mente se sinti&oacute; liberada y despejada para poder pensar y buscar mejor.</strong></p>\r\n<p>Pero no creas que esto es todo, tambi&eacute;n nos ayuda en la parte emocional, mejorando nuestro estado de &aacute;nimo, proporcion&aacute;ndonos una sensaci&oacute;n de sosiego, calma y tambi&eacute;n fortaleza interior, que redunda positivamente en nuestra autoestima.</p>\r\n<p class=\"txtdestacadog\">Adem&aacute;s la naturaleza nos permite maravillarnos de toda su belleza d&iacute;a a d&iacute;a y trabajar nuestro lado m&aacute;s espiritual, trabajando el sentimiento de agradecimiento por todo lo que nos rodea, algo esencial para llevar una vida m&aacute;s plena.</p>\r\n</div>\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>La naturaleza inspira nuestra mente y sana nuestro cuerpo</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">No siempre tenemos la posibilidad de alejarnos de la ciudad durante horas o d&iacute;as. Sin embargo, hay muchas maneras de buscar la conexi&oacute;n con la naturaleza en nuestro d&iacute;a a d&iacute;a, aunque sea por unos pocos minutos. Aqu&iacute; tienes algunas propuestas:</span></p>\r\n</div>\r\n<div class=\"col-md-12\" style=\"text-align: justify;\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-15.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\" style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Mira por la ventana.</strong> Mira varias veces al d&iacute;a por la ventana. Observa el cielo, las nubes, el sol, los p&aacute;jaros que pueda haber volando y las plantas que veas. Siente la temperatura, el aire, los rayos de sol en tu cara o las gotas de lluvia. Intenta escuchar los sonidos de la naturaleza entre los ruidos de la ciudad. Observa c&oacute;mo se mecen la hierba o las hojas al viento.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Pasea por la naturaleza. </strong>Un paseo por el campo, el bosque, la monta&ntilde;a, la playa o un parque te permite conectar con la naturaleza, de vez en cuando prioriza este plan en tu tiempo libre. Intenta aparcar tus pensamientos y prestar atenci&oacute;n a tu entorno. Contempla las diferentes tonalidades de la tierra y de las plantas y &aacute;rboles. Abre tus sentidos a las sensaciones, olores y sonidos. Si puedes, incluso camina un rato descalzo. Experimenta la temperatura, nivel de humedad y textura del suelo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Sum&eacute;rgete en la naturaleza. </strong>Sea en un parque, un bosque, una monta&ntilde;a o una playa, detente un rato. Si&eacute;ntate y sum&eacute;rgete en lo que te rodea. Impr&eacute;gnate de las sensaciones visuales, auditivas, olfativas y t&aacute;ctiles. Inspira los olores caracter&iacute;sticos de la estaci&oacute;n: el olor a tierra, a plantas y &aacute;rboles, a arena y mar etc. Agudiza el o&iacute;do para escuchar los animales que te rodean: p&aacute;jaros, insectos, ardillas o lo que sea. Mira hacia todos los lados. Luego c&eacute;ntrate en algo en concreto y obs&eacute;rvalo con mucha atenci&oacute;n: la hierba, una planta, una flor o un &aacute;rbol. T&oacute;mate tiempo para contemplar y apreciarlo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Practica deporte al aire libre. </strong>Es otra manera de conectar con la naturaleza. Puedes salir a correr, montar en bicicleta o patinar. Pero tambi&eacute;n te puedes apuntar a grupos que practican crossfit, yoga, taichi etc. al aire libre. Adem&aacute;s puedes practicar senderismo, monta&ntilde;ismo, nataci&oacute;n, buceo o montar a caballo por ejemplo aunque sea puntualmente.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Saca tu lado creativo. </strong>&iquest;Te gusta dibujar o pintar? Entonces sal al exterior y si&eacute;ntate a plasmar tu entorno sobre papel. Si prefieres la fotograf&iacute;a, aprecia la naturaleza inmortalizando el paisaje con tu m&oacute;vil o c&aacute;mara. Otras ideas pueden ser recolectar hojas o casta&ntilde;as para hacer manualidades con tus hijos. O salir al bosque a buscar bayas o setas para despu&eacute;s cocinar un sabroso plato o preparar un pastel delicioso.</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Hay mucho tipos de naturaleza. &iquest;Eres m&aacute;s de playa o de monta&ntilde;a? &iquest;De paisajes ex&oacute;ticos o de campo? Te animamos a que realices este divertido juego para llegar a tu lugar ideal de la naturaleza.</span></p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"CONECTA CON LA NATURALEZA (CONCIENCIAR)\" src=\"https://view.genial.ly/63cfbb49450a580011e88271\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>La naturaleza inspira nuestra mente y sana nuestro cuerpo</h4>\r\n<p><strong>Y para cuando si puedas pasar el d&iacute;a en un entorno natural, te animamos a que lo aproveches al m&aacute;ximo.</strong> Practica la atenci&oacute;n plena, poniendo todos tus sentidos en lo que te rodea, inspira sus olores, el olor a tierra, a plantas y &aacute;rboles, a arena y mar etc. Agudiza el o&iacute;do para escuchar los animales que te rodean: p&aacute;jaros, insectos, ardillas o lo que sea. Mira hacia todos los lados. Luego c&eacute;ntrate en algo en concreto y obs&eacute;rvalo con mucha atenci&oacute;n: la hierba, una planta, una flor o un &aacute;rbol. T&oacute;mate tiempo para contemplar y apreciarlo. Incluso ac&eacute;rcate a oler una flor, un &aacute;rbol, una hoja..</p>\r\n<p><strong>En pocas palabras, practica la atenci&oacute;n plena cuando disfrutes de una experiencia en la naturaleza y aprende a captar todos los detalles que ocurren en ella.</strong></p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te desafiamos a que compartas tu rinc&oacute;n favorito de la naturaleza, aquel lugar en el que te olvidas de todas tus preocupaciones y en el que te sientes totalmente conectado con la naturaleza. Puedes compartir una foto y el nombre del lugar. Adem&aacute;s comparte con tus compa&ntilde;eros si practicas de manera activa la meditaci&oacute;n y que beneficios has conseguido practic&aacute;ndola.</p>\r\n<div style=\"width: 100%;\">&nbsp;</div>\r\n<div class=\"btnctr\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotos-cuadradas-plataforma-420-x-420-px-5.jpg\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>',7,0,1,1,'2021-07-04 10:03:52','2023-01-31 15:13:38'),(36,1,'La naturaleza en nuestro hogar','la-naturaleza-en-nuestro-hogar','<p><span style=\"font-size: 12pt;\">La vida en las ciudades nos suele desconectar de la vida natural. Nos sumergimos en sonidos, olores, alimentos, construcciones y situaciones que nos dejan cada vez m&aacute;s distantes del medio natural, para el cual nuestro cuerpo fue proyectado para funcionar. </span></p>\r\n<p><span style=\"font-size: 12pt;\"> Edificios cada vez m&aacute;s altos, cientos de luces cegadoras y un concierto de disonancias&nbsp;son las barreras modernas que impiden a muchos de nosotros entablar un di&aacute;logo activo con la naturaleza.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Para muchas personas disfrutar de la naturaleza con cierta frecuencia se ha convertido en algo poco frecuente. A veces no se encuentra a nuestro alcance, sin embargo en otras ocasiones es el resultado de la vida moderna. El mundo, hoy en d&iacute;a, ha olvidado los valiosos aportes que nos brinda la naturaleza. </span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>Ya aprendimos en el anterior desaf&iacute;o de Reconectar, la infinidad de beneficios que nos brinda la conexi&oacute;n con la naturaleza. Tambi&eacute;n descubrimos algunos recursos para poder disfrutar de la naturaleza, a pesar de vivir en una ciudad rodeados de cemento.</p>\r\n<p>Y hoy queremos profundizar un poco m&aacute;s acerca de las alternativas que tenemos para que nuestra relaci&oacute;n org&aacute;nica con la naturaleza&nbsp;no se vea interrumpida, ya que de ser as&iacute; podr&iacute;a acabar perjudicando nuestra salud.</p>\r\n<p>Existen varios&nbsp;m&eacute;todos de&nbsp;curaci&oacute;n cognitiva org&aacute;nica, uno de ellos es sin duda construir un ecosistema natural en nuestro propio hogar, por ejemplo construyendo un huerto urbano.</p>\r\n<p class=\"txtdestacadog\">No olvides que el ser humano para vivir feliz, y mantener la salud f&iacute;sica o mental, necesita sentirse cerca de la naturaleza..</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Rodearse de naturaleza</h4>\r\n<p>Un huerto urbano es una magn&iacute;fica forma de estar m&aacute;s cerca de la naturaleza para aquellas personas que no tienen un f&aacute;cil acceso a un entorno natural.</p>\r\n<p>El cultivar nuestra propia verdura sabiendo qu&eacute; y c&oacute;mo consumimos, es algo que hoy d&iacute;a est&aacute; muy valorado y que ha podido demostrar a lo largo de todo este tiempo sus enormes beneficios.</p>\r\n<p>Hoy d&iacute;a los huertos urbanos se han convertido en una&nbsp;alternativa sostenible para la producci&oacute;n de verduras frescas, adem&aacute;s de un hobby apasionante y educativo para los m&aacute;s peque&ntilde;os.</p>\r\n<p>Un&nbsp;huerto urbano es equiparable a un huerto en el jard&iacute;n, se trata de espacios cubiertos o no para el cultivo de hortalizas y frutas a escala dom&eacute;stica.&nbsp;La calidad de los productos puede ser igual que en cualquier otro tipo de cultivo.</p>\r\n<p>Los beneficios y las ventajas de un huerto urbano son m&uacute;ltiples y variados, podemos hablar de:</p>\r\n<ul>\r\n<li><strong>Fomenta h&aacute;bitos alimenticios mas saludables</strong>, mejora tu salud y la de los tuyos.</li>\r\n<li><strong>Satisfacci&oacute;n </strong>por consumir nuestros propios cultivos.</li>\r\n<li><strong>Ahorramos dinero.</strong> El coste de producir nuestras propias hortalizas es muy inferior al precio de mercado.</li>\r\n<li><strong>Alimentamos una cultura </strong>que en algunas ciudades se hab&iacute;a perdido..</li>\r\n<li>Nos hace entender, valorar y <strong>respetar la naturaleza.</strong></li>\r\n<li><strong>Aumentamos las zonas verdes</strong> en las ciudades, tan necesarias en la mayor&iacute;a de ellas.</li>\r\n<li><strong>Reducimos nuestra huella de carbono</strong> ya que los productos son locales, tan locales que no tenemos que movernos de casa para obtenerlos.</li>\r\n</ul>\r\n<p>En la secuencia de im&aacute;genes de la derecha, podr&aacute;s coger algunas ideas sobre qu&eacute; plantar si es que eres principiante en la materia, ya que se trata de frutas y hortalizas f&aacute;ciles de cultivar. &iquest;Te animas?</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te retamos a que construyas tu propio huerto. Te animamos a que escuches este tutorial sobre algunas cuestiones pr&aacute;cticas que tendr&aacute;s que tener en cuenta si finalmente te animas. &iquest;No crees que puede resultar muy gratificante comer tus propias verduras u hortalizas?</p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 60.00%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" src=\"https://www.youtube.com/embed/mkbaohuanNo\" width=\"1000\" height=\"600\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n<p class=\"txtdestacadog\">Adem&aacute;s, atr&eacute;vete con este divertido rosco de pasapalabra, podr&aacute;s medir tus conocimientos sobre horticultura</p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 66.67%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"Copy - EL ABECEDARIO  DEL HUERTO\" src=\"https://view.genial.ly/63f339a43895e8001103c7db\" width=\"1200\" height=\"800\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/verticales-concienciar-2.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/frutas-f%C3%A1ciles-de-cultivar.gif\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Las plantas suben el &aacute;nimo</h4>\r\n<p>Ya hemos visto los beneficios de cultivar nuestro propio huerto en casa, pero tambi&eacute;n cultivar plantas&nbsp; y cuidarlas nos proporciona incre&iacute;bles beneficios para nuestro bienestar general. Las plantas son aromatizantes naturales, mejoran el estado an&iacute;mico, purifican el aire, ayudan a respirar mejor, reducen la electricidad est&aacute;tica, reducen la contaminaci&oacute;n y la poluci&oacute;n, adem&aacute;s de mejorar nuestra productividad y por supuesto de adornar nuestro hogar convirti&eacute;ndolo en un espacio mucho m&aacute;s acogedor y saludable.</p>\r\n<p>En pocas palabras, tener plantas en nuestro hogar es otra manera de sentirnos m&aacute;s cerca y m&aacute;s conectados con la naturaleza.</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te desafiamos a que compartas alguna foto de las plantas que tienes en tu casa, o si dispones de huerto tambi&eacute;n puedes compartir una foto. Puedes acompa&ntilde;ar la foto con el nombre de lo que cultivas. &iexcl;De esta manera aprendemos todos!&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/cuadradas-concienciar.gif\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>',3,0,1,1,'2021-07-05 08:00:16','2023-03-15 08:20:54'),(39,3,'Menos es m치s','menos-es-mas','<p><span style=\"font-size: 12pt;\">El minimalismo se ha convertido en la tendencia m&aacute;s buscada en todos los aspectos: en la moda, en la belleza y en la decoraci&oacute;n. La sencillez triunfa porque es elegante, atemporal y cl&aacute;sica.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong> Pero adem&aacute;s hay otro aspecto a tener en cuenta, el minimalismo y la sostenibilidad medio ambiental comparten objetivos, </strong>como hacer un uso m&aacute;s responsable de los recursos, lo que supone no solo consumir menos, sino apostar por productos de m&aacute;s calidad y vida &uacute;til.</span></p>\r\n<p><span style=\"font-size: 12pt;\">El protagonismo de la luz y el entorno natural; el uso de materiales no procesados; o la austeridad, sobriedad son tambi&eacute;n perfectamente coherentes con la idea de una tendencia sostenible con el medio ambiente.</span></p>','<p><span style=\"font-size: 12pt;\">El acto m&aacute;s sostenible es aquel que no requiere la fabricaci&oacute;n de ning&uacute;n objeto, por lo tanto, la mejor manera de contribuir a la sostenibilidad es reducir el consumo.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong> Tambi&eacute;n el acto de reflexionar acerca de lo que realmente necesito y prescindir de todo aquello que no es esencial ni necesario.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Ofrecer una segunda vida a aquellas pertenencias que no est&eacute;n siendo utilizadas o que no sean esenciales para nuestro d&iacute;a a d&iacute;a.</span></p>\r\n<p><span style=\"font-size: 12pt;\"> &iquest;No te has parado a pensar que seguramente cuentes con objetos que no est&eacute;s utilizando y que sin embargo puedan resultar muy &uacute;tiles para otras personas? </span></p>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Deshazte de aquello que NO necesitas</h4>\r\n<p>Una cosa est&aacute; clara, el orden, o el caos de tu entorno tienen mucho que ver con tu bienestar, tu concentraci&oacute;n o tu eficiencia.</p>\r\n<p>El orden o el desorden interno se proyectan hacia afuera. Numerosos estudios afirman que el orden&nbsp;favorece la productividad, mejora el rendimiento, facilita la ejecuci&oacute;n de tareas, nos hace ser m&aacute;s voluntariosos y tambi&eacute;n aporta sensaci&oacute;n de control, seguridad y equilibrio.</p>\r\n<p>El orden nos gusta, nos transmite paz, nos equilibra, nos hace el d&iacute;a a d&iacute;a m&aacute;s f&aacute;cil y hace que nos sintamos mejor. &iquest;No crees? Observa esta secuencia de im&aacute;genes. &iquest;Cu&aacute;l de ellas te produce mayor sensaci&oacute;n de bienestar?</p>\r\n<p>As&iacute; es. Ver una estancia ordenada es mucho m&aacute;s agradable que un espacio desordenado. &nbsp;Al simplificarnos la vida, nos hace sentirnos&nbsp;m&aacute;s tranquilos, m&aacute;s felices&nbsp;y tener mejor relaci&oacute;n con el resto de habitantes de la casa.</p>\r\n<p>Ser organizado ahorra tambi&eacute;n dinero, ya que evita, por ejemplo, duplicar compras de productos que no ve&iacute;amos a causa del desorden. <strong>Pero el mayor beneficio que nos aporta el orden es que&nbsp;nos regala much&iacute;simo tiempo,&nbsp;para disfrutar de las cosas que realmente nos importan.</strong></p>\r\n<p>Saber ordenar es importante, pero no lo es todo. Podemos pasar horas o d&iacute;as recogiendo y no estar satisfechos. <strong>La clave est&aacute; en deshacerte de todo lo que no te inspire alegr&iacute;a.</strong> La experta en orden Marie Kondo recomienda guardar &uacute;nicamente las cosas que &ldquo;hablan a tu coraz&oacute;n&rdquo;. Tirar o regalar todos esos objetos que no son necesarios y que acumulamos sin sentido es una nueva forma de mejorar nuestro estado de &aacute;nimo y deshacernos del caos.</p>\r\n<p>Todo aquello que decidas desechar, puedes venderlo, donarlo o regalarlo a alguien que le puede dar una utilidad real. <strong>Deshacerte, de un modo u otro, de aquello que hace tiempo que no usas, te servir&aacute; para liberar espacio y mantener tu casa m&aacute;s organizada y despejada.</strong></p>\r\n<p>Dedica un tiempo prudencial a&nbsp;llevar a cabo una primera selecci&oacute;n de aquellas piezas, accesorios de cocina o ba&ntilde;o, ropa o zapatos que realmente hace tiempo que no tienen utilidad. Despu&eacute;s podr&aacute;s analizar si realmente necesitas estos objetos o no y as&iacute; tomar la decisi&oacute;n definitiva.</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te retamos a que aceptes el prop&oacute;sito de mantener tu casa y tu espacio de trabajo m&aacute;s ordenado. Te hemos preparado un v&iacute;deo con la organizadora profesional, Vanesa Travieso (@ponorden), primera alumna espa&ntilde;ola formada por Marie kondo que nos explicar&aacute; los TIPS fundamentales para mantener nuestro hogar en orden y en equilibrio.</p>\r\n<p class=\"txtdestacadog\">Y para terminar, puedes descargarte estos consejos b&aacute;sicos que te ayudar&aacute;n a mantener tu espacio en orden.</p>\r\n<div style=\"width: 100%;\">\r\n<p><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/consejos-sobre-orden.pdf\">CONSEJOS</a></p>\r\n<div style=\"position: relative; padding-bottom: 60.00%; padding-top: 0; height: 0;\">&nbsp;</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/hogar-desordenado.gif\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/hogar-odenado.gif\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>\r\n<p><iframe title=\"YouTube video player\" src=\"https://www.youtube.com/embed/IgwaWWa6hZQ\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>',1,'<div class=\"row\">\r\n<div class=\"col-md-6\"><img style=\"float: left;\" src=\"../../../../storage/files/uploads/escritorio-ordenado.jpg\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Rod&eacute;ate de cosas que te hagan feliz.</h4>\r\n<p>Da igual si trabajas en casa o tienes un rinc&oacute;n en el que te gusta sentarte a leer o a coser, lo importante es que crees&nbsp;un espacio que favorezca la concentraci&oacute;n. Para ello debes tener en cuenta que debe ser amplio, alejado del ruido y con suficiente luz; si es natural, mejor.</p>\r\n<p><strong>No te olvides de rodearte de objetos que te hagan sentir bien, que te evoquen buenos recuerdos y que te ayuden a conectar con un estado de bienestar emocional.</strong></p>\r\n<p>La decoraci&oacute;n, el orden y la limpieza, los colores y los ambientes que creamos influyen en nuestros pensamientos y en la producci&oacute;n de hormonas y neurotransmisores en el cerebro, haciendo posible que&nbsp;aumente nuestro bienestar emocional radicalmente. En general poner algo de orden en tu entorno es dar un paso hacia el bienestar.</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Ahora que te has iniciado en esto del orden nos gustar&iacute;a que compartieras una foto de tu lugar de trabajo ahora mismo, &iexcl;Venga an&iacute;mate! y si quieres comparte con nosotros qu&eacute; aspecto del orden te cuesta m&aacute;s mantener a ralla.</p>\r\n</div>\r\n</div>',7,0,1,1,'2021-07-14 15:30:11','2022-06-01 09:12:37'),(42,2,'Por un mar con m치s vida','por-un-mar-con-mas-vida-1','<p class=\"p1\"><span style=\"font-size: 12pt;\"><strong>Cada a&ntilde;o vertemos en los mares m&aacute;s de doce millones de toneladas de residuos de pl&aacute;stico.</strong></span></p>\r\n<p class=\"p1\"><span style=\"font-size: 12pt;\">Somos tan ignorantes que pensamos que ese pl&aacute;stico no volver&aacute;. Los micro pl&aacute;sticos se filtran por todas partes, los fragmentos m&aacute;s peque&ntilde;os del pl&aacute;stico acaban en el organismo de los seres vivos, incluidas las especies que nos sirven de alimento.</span></p>\r\n<p class=\"p1\"><span style=\"font-size: 12pt;\">Actualmente, unas 700 especies de organismos marinos se ven afectados por este tipo de contaminaci&oacute;n.&nbsp;<strong>Cada a&ntilde;o, m&aacute;s de un mill&oacute;n de aves y m&aacute;s de 100.000 mam&iacute;feros marinos mueren como consecuencia de todos los pl&aacute;sticos que llegan al mar.</strong></span></p>\r\n<p>&nbsp;</p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p class=\"p1\">Generamos 500 millones de toneladas anuales. De los cuales el 80% son pl&aacute;sticos de un solo uso.</p>\r\n<p class=\"p1\">Si seguimos as&iacute;. En el 2050 habr&aacute; m&aacute;s pl&aacute;sticos que peces en el mar.</p>\r\n<p class=\"p1\">El problema no es el pl&aacute;stico, es el uso y abuso que hacemos de el. Los pl&aacute;sticos son materiales seguros cuando se utilizan como es debido y son sometidos a un debido control a lo largo de toda su cadena. La peor decisi&oacute;n que tomamos fue elaborar con ellos productos de un solo uso, de usar y tirar. Aunque afortunadamente ya se est&aacute;n tomando medidas para controlar su uso, todav&iacute;a hay mucho por hacer.&nbsp; Y gran parte de ello depende de nosotros y de nuestros actos y decisiones.&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-4\">&nbsp;</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h3>Los pl&aacute;sticos que usamos cada d&iacute;a pueden acabar en nuestros mares y oc&eacute;anos.</h3>\r\n<p>Aunuque los hayamos depositado correctamente en el contenedor amarillo.</p>\r\n<p>Cada vez se producen m&aacute;s objetos de pl&aacute;stico,&nbsp; como platos, vasos, botellas o bolsas. Cuando nos deshacemos de ellos pueden acabar en un vertedero, ser incinerados o reciclados. Sin embargo, debido a la acci&oacute;n del viento y la lluvia, estos residuos tambi&eacute;n pueden llegar al mar incluso cuando los tiramos a la basura. Pueden acabar abandonados debido a la acci&oacute;n de las tormentas, el viento o la lluvia, o simplemente porque no se han desechado correctamente. As&iacute; pueden llegar a r&iacute;os u otras v&iacute;as fluviales y hasta en el sistema de alcantarillado de zonas urbanas. Una vez ah&iacute;, a no ser que se extraigan con anterioridad, su destino final ser&aacute; el mar por muy lejos que nos encontremos de la costa.</p>\r\n<p>Una vez los objetos de pl&aacute;stico llegan al medio marino&nbsp;<strong>tardan entre d&eacute;cadas y cientos de a&ntilde;os en degradarse.</strong> El tiempo de degradaci&oacute;n depende del tipo de pl&aacute;stico y de las condiciones ambientales a las que se expone (luz solar, ox&iacute;geno, agentes mec&aacute;nicos). En el caso de los oc&eacute;anos, la radiaci&oacute;n UV procedente de la luz solar es el principal agente que degrada el pl&aacute;stico. La acci&oacute;n del oleaje acelera este proceso y como resultado los fragmentos m&aacute;s grandes se van rompiendo en trozos m&aacute;s peque&ntilde;os, generando micropl&aacute;sticos.</p>\r\n<p>Aunque no lo creas, gran parte de este pl&aacute;stico puede reducirse y est&aacute; en tus manos que as&iacute; sea. Actuando con tu consumo y tus rutinas en tu d&iacute;a a d&iacute;a.&nbsp;</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Mira a tu alrededor. Analiza todo aquel pl&aacute;stico que usas a diario o a menudo y que podr&iacute;as eliminar o sustituir por alternativas m&aacute;s respetuosas. &iquest;Porqu&eacute; no pruebas a hacer una compra libre de pl&aacute;sticos?&nbsp;</p>\r\n<p class=\"txtdestacadog\">Adem&aacute;s para que vayas cogiendo algunas ideas, sobre alternativas m&aacute;s sostenibles que pueden sustituir al pl&aacute;stico,&nbsp; te desafiamos a que realices este divertido juego de memoria. &iexcl;No olvides apuntar tu tiempo!</p>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"REDUCIR PL&Aacute;STICOS (CONCIENCIAR)\" src=\"https://view.genial.ly/63ce64fe6600ae001861298e\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"btnctr\">&nbsp;</div>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520.gif\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n</div>\r\n<!--<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" src=\"https://view.genial.ly/608a5fe2ee6d090d34f2884c\" width=\"1200px\" height=\"675px\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\">&nbsp;</div>\r\n</div>--></div>',1,'<div class=\"row\">\r\n<div class=\"col-md-8\" style=\"text-align: left; font-size: 12pt;\">\r\n<h4>Los mares se est&aacute;n convirtiendo en vertederos de pl&aacute;stico.&nbsp;</h4>\r\n<p>Hoy en d&iacute;a solo el 9% de todo el pl&aacute;stico que hemos producido y consumido hasta la actualidad a nivel mundial se ha reciclado, el 12% se ha incinerado, y&nbsp;<strong>la gran mayor&iacute;a, el 79%, ha terminado en vertederos o en el medio ambiente.</strong>&nbsp;Los objetos de pl&aacute;stico tambi&eacute;n pueden llegar al mar desde vertederos, por el agua que fluye por los mismos. Adem&aacute;s, tambi&eacute;n encontramos<strong>&nbsp;pl&aacute;sticos en el mar</strong>&nbsp;que proceden de vertidos de basura deliberados, de vertidos accidentales desde barcos, o de los efluentes de las estaciones depuradoras y plantas de tratamiento de aguas residuales. El&nbsp;<strong>80% de los residuos que encontramos en el mar proviene de tierra, mientras que el 20% restante de la actividad mar&iacute;tima.</strong></p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\">Hoy te desafiamos a qu&eacute; compartas en el muro cu&aacute;l han sido tus logros en la reducci&oacute;n de pl&aacute;stico. &iquest;Te has pasado a la bolsa reutilizable? &iquest;A la compra a granel? &iquest;Has descartado la fruta o verdura envasada en pl&aacute;stico?</p>\r\n<div style=\"width: 100%;\">\r\n<p class=\"p1\">Y sobre todo no te desanimes. &iexcl;Todo es empezar!</p>\r\n</div>\r\n<div class=\"btnctr\">&nbsp;</div>\r\n</div>\r\n<div class=\"col-md-4\"><img src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-1.gif\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n</div>\r\n<!--<div style=\"width: 100%;\">\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\">&nbsp;</div>\r\n</div>--></div>',7,0,1,1,'2023-01-30 07:33:29','2023-01-31 15:56:03');
