INSERT INTO `categories` VALUES (1,'Reconectar','reconectar-1','Los humanos solo protegemos aquello que amamos. Para cuidar de la naturaleza antes tendremos que conocerla y saber conectar con ella.','<p><span style=\"font-size: 12pt;\">Del mismo modo que&nbsp;alejarnos de la naturaleza hace enfermar&nbsp;al planeta y a nosotros mismos, conectar con la naturaleza nos aporta&nbsp;innumerables beneficios. Un gran n&uacute;mero de estudios han demostrado que pasar tiempo en la naturaleza mejora la salud f&iacute;sica,&nbsp; el bienestar mental y la felicidad. </span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong>El contacto con la naturaleza tiene muchos beneficios, como por ejemplo una mejora en el estado de &aacute;nimo o una reducci&oacute;n en los niveles de ansiedad</strong>. Adem&aacute;s, el tiempo que pasamos con la naturaleza tambi&eacute;n favorece a &nbsp;nuestras relaciones sociales, haci&eacute;ndonos m&aacute;s amables y comunitarios.&nbsp;</span></p>\r\n<p><span style=\"font-size: 12pt;\">Por otro lado, algunas de las experiencias m&aacute;s asombrosas de nuestra vida ocurren cuando estamos inmersos en la naturaleza. Por ello, es tan importante que nos involucremos en preservar la naturaleza, no solo por nosotros, sino por las futuras generaciones y por todo lo que les queda por vivir.&nbsp;</span></p>\r\n<p><strong><span style=\"font-size: 12pt;\">Volver a conectar con la naturaleza no es un capricho, sino una necesidad vital para cualquier persona que desea sentirse bien consigo misma tanto a nivel f&iacute;sico, como psicol&oacute;gico y emocional.</span></strong></p>\r\n<p><span style=\"font-size: 12pt;\">A continuaci&oacute;n te proponemos una serie de desaf&iacute;os que te ayudar&aacute;n &nbsp;a conectar con la naturaleza y con el entorno natural.</span></p>\r\n<p>&nbsp;</p>',4,1,1,'2021-05-03 12:57:24','2022-04-11 14:41:49'),(2,'Reducir','reducir','Reducir el consumo para respetar el tiempo de la regeneraci칩n natural de la tierra. Reduciendo el problema disminuimos el impacto.','<p>&nbsp;</p>\r\n<p>Existe una necesidad inminente de comenzar a <strong>adaptar nuestro consumo para conseguir equilibrar el tiempo de la regeneraci&oacute;n natural de la tierra</strong>. Esto s&oacute;lo ser&aacute; posible cambiando nuestros h&aacute;bitos de consumo y llev&aacute;ndolos hacia un modelo m&aacute;s sostenible.</p>\r\n<p>Un consumo m&aacute;s consciente y responsable tiene como consecuencia una reducci&oacute;n en el volumen de residuos, un menor gasto de materias primas, agua, contaminaci&oacute;n y consumo de energ&iacute;a entre otras cosas.</p>\r\n<p>Se trata de modificar nuestra conducta a la hora de escoger y adquirir nuevos &nbsp;productos, practicando un &nbsp;consumo responsable,&nbsp; sostenible y consciente. <strong>El consumidor responsable busca la opci&oacute;n de consumo con menor impacto negativo sobre el medio ambiente y con mejor efecto positivo en la sociedad.</strong></p>\r\n<p>Queremos proponerte algunas acciones y h&aacute;bitos para &nbsp;llevar una vida m&aacute;s sostenible y respetuosa con el medio. Hablamos de reducir al m&aacute;ximo los productos de un solo uso,&nbsp; de tener prudencia para pensar antes de cada compra en si es estrictamente necesario, &nbsp;o por ejemplo en limitar el uso y la compra de productos con demasiado envoltorio o embalaje.</p>\r\n<p>En definitiva, una vida sostenible o en equilibrio con nuestro entorno es algo que debemos crear continua y conjuntamente.</p>\r\n<p>Esperamos que a trav&eacute;s de estos desaf&iacute;os que hemos preparado aprendas la manera de empezar a ponerlo en pr&aacute;ctica.</p>',1,1,1,'2021-05-03 12:57:24','2022-04-04 07:52:46'),(3,'Reutilizar','reutilizar','Los residuos y objetos tambi칠n merecen una segunda oportunidad. Se trata de reinventar para crear nuevas soluciones y funciones.','<p><strong>El proceso de reutilizar consiste en dar una segunda oportunidad a un objeto que &iacute;bamos a desechar</strong>, es decir, darle un nuevo fin a ese objeto antes de que se convierta en un residuo y que acabe acumul&aacute;ndose en la naturaleza.</p>\r\n<p><strong>La reutilizaci&oacute;n es sumamente importante en la ecolog&iacute;a. Reduce la producci&oacute;n de basura de cada habitante. P</strong>ermite elaborar soluciones con materiales alternativos. Adem&aacute;s, no tiene coste alguno, podremos lograr crear fant&aacute;sticas obras de arte, herramientas, utilidades incluso juguetes sin gastar dinero.</p>\r\n<p><strong>Adentrarnos en la pr&aacute;ctica de Reutilizar nos ayuda a cambiar nuestra forma de ver el mundo</strong>. Al tirar o rechazar objetos estamos creando toneladas de basura anualmente, muchas veces estos objetos no permiten un posterior reciclaje o reaprovechamiento de sus componentes y por tanto acaban acumulados en vertederos con el consecuente impacto medioambiental.</p>\r\n<p>El upcycling, conocido tambi&eacute;n como suprarreciclaje, es el arte de crear nuevas piezas a partir de viejos objetos o residuos que aparentemente ya no ten&iacute;an ning&uacute;n uso.</p>\r\n<p>Mediante un poco de imaginaci&oacute;n conseguiremos reaprovechar gran parte de los residuos que generamos en nuestro d&iacute;a a d&iacute;a.</p>\r\n<p>A trav&eacute;s de estos desaf&iacute;os que hemos preparado descubrir&aacute;s infinidad de alternativas, antes de lanzar o desechar un objeto. &iquest;Te animas?</p>\r\n<p>&nbsp;</p>',2,1,1,'2021-05-03 12:57:24','2022-04-11 14:42:00'),(4,'Reciclar','reciclar','Aprender a separar y clasificar correctamente nuestros residuos y desechos por un futuro y un planeta m치s limpio en el que vivir.','<p>Los beneficios de reciclar nuestros residuos son enormes en comparaci&oacute;n con la acci&oacute;n que supone. Reciclar conlleva ahorrar materias primas, energ&iacute;a, agua y reducir las emisiones de gases de efecto invernadero.</p>\r\n<p><strong>Reciclando evitamos que los productos y materiales se conviertan en residuos, transform&aacute;ndolos en otros completamente nuevos, alargando su vida &uacute;til y ayudando a la preservaci&oacute;n de los recursos naturales del planeta.</strong></p>\r\n<p>El reciclaje forma parte de la Econom&iacute;a Circular, el modelo basado en aprovechar al 100% las materias primas, haciendo m&aacute;s eficientes los procesos de uso y fabricaci&oacute;n. Diversos estudios han demostrado que la energ&iacute;a necesaria para conseguir materia prima reciclada es menor que la utilizada para obtener materia prima virgen.</p>\r\n<p><strong>Obtener las materias primas necesarias para fabricar algunos productos genera m&aacute;s sustancias contaminantes que si estas mismas fuesen recicladas</strong>, es decir, se genera menos CO2 a la atm&oacute;sfera y se reduce la contaminaci&oacute;n emitida. Tambi&eacute;n producir papel desde cero supone m&aacute;s cantidad de agua que utilizar papel reciclado.</p>\r\n<p>El reciclaje deber&iacute;a formar parte de nuestro d&iacute;a a d&iacute;a, deber&iacute;amos reciclar en casa, en la oficina, en la calle... y para que este proceso sea mucho m&aacute;s f&aacute;cil queremos proponerte una serie de actividades y recomendaciones para que puedas adoptar el reciclaje de forma natural en tu vida y en tu rutina.</p>\r\n<p>&nbsp;</p>',3,1,1,'2021-05-03 12:57:24','2022-04-11 14:41:37');
